* Non Venomous *

Streaked Kukri Snake (Oligodon taeniolatus) is a species of nonvenomous snake found in Asia. Also known as the Variegated Kukri or the Russell's Kukri.

These snakes are specialised for feeding on egg yolk (and not complete egg) by making slit on soft shelled eggs with their sharp tooth. These special tooth are present on the middle of upper jaw and of Kukri/Khukhri knife shaped. Many species feed other animals too which include lizards and mice. 
P.S. Russell's Kukri is one of the most widespread Oligodon and makes westernmost limit of its genus in Iran. 

Family: Colubridae

Genus: Oligodon

Species: O. taeniolatus

Binomial name: Oligodon taeniolatus
